import React, { memo } from 'react'
import { useSelector } from 'react-redux'

export default memo(function Banner() {
  // 从store中获取数据
  const { banner } = useSelector((state) => ({
    banners: state.Banner
  }))
  return (
    <div>
      Banner
    </div>
  )
})
